bool allow(uint8_t type, int value) {
    int i = 0;

    for (i = 0; i < SLEN; i++) {
        if (match(strategy[i].state) == 1) {
            if(strategy[i].action.type == type && strategy[i].action.value == value){
                return 1;
            }
        }
    }

    return 0;
}

int is_state_contained(){
    int i = 0;

    for (i = 0; i < SLEN; i++) {
        if (match(strategy[i].state) == 1) {
            return 1;
        }
    }

    return 0;
}

int get_action(uint8_t* type, int* value) {
    int i = 0, j = 0;

    for(j = 0; j < ACTNUM; j++){
        type[j] = 50;
        value[j] = -10;
    }
    for (i = 0, j = 0; i < SLEN; i++) {
        if (match(strategy[i].state) == 1) {
            type[j] = strategy[i].action.type;
            value[j] = strategy[i].action.value;
            j++;
        }
    }

    return 0;
}

int set_cps_state(int32_t x, int32_t y, 
    int32_t velocity, int32_t orientation, 
    int32_t acceleration){
    g_cps_i_state.position.x = x;
    g_cps_i_state.position.y = y;
    g_cps_i_state.velocity = velocity;
    g_cps_i_state.orientation = orientation;
    g_cps_i_state.acceleration = acceleration;

    return 1;
}

int set_obs_state(int32_t id, int32_t x, int32_t y, 
    int32_t velocity, int32_t orientation, 
    int32_t acceleration){
    g_obs_i_state[id].position.x = x;
    g_obs_i_state[id].position.y = y;
    g_obs_i_state[id].velocity = velocity;
    g_obs_i_state[id].orientation = orientation;
    g_obs_i_state[id].acceleration = acceleration;

    return 1;
}

